import React from 'react';

const BoardButton: React.FC = ({keyID, tileName, onClick}) => {
	// const name = props.tileName === "tile-on" ? "on" : "off";
	return (
		<div>
			<div className={tileName} key={keyID} onClick={onClick}></div>
		</div>
	)
}

export {};
